import React from 'react'
import { Welcome } from './Welcome'

export const App = () => {
    let user;

    const ubah = () => {
        return(
            user = "Edward",
            console.log(user),
            tampil()
        );
    }
    const tampil = () =>{
        <Welcome name={user}/>
    }
  return (
    <div>
        <button onClick={() => ubah()}>Login</button>
        tampil()
    </div>
  )
  
}
